import React from 'react'
import AuthForm from '../Auth/AuthForm'

const Admin = () => {
  return (
    <div>
      const getData =(data)={};
      return(<div>
        <AuthForm onSubmit={getData}/>
      </div>)
    </div>
  )
}

export default Admin
